  \"narrative-report-for-lostwood-national-wildlife-refuge-september-through-december-1948\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lostwood National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1948. The report begins by summarizing the weather conditions, water conditions,
  food and cover, and wildfires during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, and rodents-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. Resource management is outlined; topics include grazing
  and haying. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses,
  Refuge visitors, Refuge participation, and hunting. N-R forms and photographs are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
